INSERT INTO "Catalog_Product" ("Id", "BrandId", "CreatedById", "CreatedOn", "Description", "DisplayOrder", "HasOptions", "IsAllowToOrder", "IsCallForPricing", "IsDeleted", "IsFeatured", "IsPublished", "IsVisibleIndividually", "MetaDescription", "MetaKeywords", "MetaTitle", "Name", "NormalizedName", "OldPrice", "Price", "PublishedOn", "RatingAverage", "ReviewsCount", "SeoTitle", "ShortDescription", "Sku", "SpecialPrice", "SpecialPriceEnd", "SpecialPriceStart", "Specification", "StockQuantity", "ThumbnailImageId", "UpdatedById", "UpdatedOn") VALUES (5, 1, NULL, '2017-02-07 00:00:00', '<p>Green Enjoy several wines and gourmet cheeses hand selected by our concierge staff, and wannabe sommeliers. 5:30 - 8:00 in the Great Room.<br></p>', 0, false, true, false, false, true, true, true, NULL, NULL, NULL, 'Wine and Cheese Party', NULL, 10, 10, NULL, 2, 0, 'wine-and-cheese-party', '<p>wine and cheese party<br></p>', NULL, NULL, NULL, NULL, NULL, NULL, 5, NULL, '2017-01-19 18:00:00');
INSERT INTO "Catalog_Product" ("Id", "BrandId", "CreatedById", "CreatedOn", "Description", "DisplayOrder", "HasOptions", "IsAllowToOrder", "IsCallForPricing", "IsDeleted", "IsFeatured", "IsPublished", "IsVisibleIndividually", "MetaDescription", "MetaKeywords", "MetaTitle", "Name", "NormalizedName", "OldPrice", "Price", "PublishedOn", "RatingAverage", "ReviewsCount", "SeoTitle", "ShortDescription", "Sku", "SpecialPrice", "SpecialPriceEnd", "SpecialPriceStart", "Specification", "StockQuantity", "ThumbnailImageId", "UpdatedById", "UpdatedOn") VALUES (6, 1, NULL, '2017-02-07 00:00:00', '<p>Karaoke night in the Venu Great Room! Join our guest host and bring your singing voice. Non-alcoholic beverages provided, and BYOB<br></p>', 0, false, true, false, false, true, true, true, NULL, NULL, NULL, 'Karaoke', NULL, 0, 0, NULL, 2, 0, 'karaoke', '<p>karaoke<br></p>', NULL, NULL, NULL, NULL, NULL, NULL, 6, NULL, '2017-01-19 19:00:00');
INSERT INTO "Catalog_Product" ("Id", "BrandId", "CreatedById", "CreatedOn", "Description", "DisplayOrder", "HasOptions", "IsAllowToOrder", "IsCallForPricing", "IsDeleted", "IsFeatured", "IsPublished", "IsVisibleIndividually", "MetaDescription", "MetaKeywords", "MetaTitle", "Name", "NormalizedName", "OldPrice", "Price", "PublishedOn", "RatingAverage", "ReviewsCount", "SeoTitle", "ShortDescription", "Sku", "SpecialPrice", "SpecialPriceEnd", "SpecialPriceStart", "Specification", "StockQuantity", "ThumbnailImageId", "UpdatedById", "UpdatedOn") VALUES (7, 1, NULL, '2017-02-07 00:00:00', '<p>Family fun! Bring your kids to the Venu Great Room, where we&#39;ll celebrate Easter early, with an egg hunt, egg coloring and other activities. Maybe the Easter Bunny will appear too. 1:00 - 4:00 PM.<br></p>', 0, false, true, false, false, true, true, true, NULL, NULL, NULL, 'Easter Egg Hunt', NULL, 0, 0, NULL, 2, 0, 'easter-egg-hunt', '<p>easter egg hunt<br></p>', NULL, NULL, NULL, NULL, NULL, NULL, 7, NULL, '2017-01-19 13:00:00');
INSERT INTO "Catalog_Product" ("Id", "BrandId", "CreatedById", "CreatedOn", "Description", "DisplayOrder", "HasOptions", "IsAllowToOrder", "IsCallForPricing", "IsDeleted", "IsFeatured", "IsPublished", "IsVisibleIndividually", "MetaDescription", "MetaKeywords", "MetaTitle", "Name", "NormalizedName", "OldPrice", "Price", "PublishedOn", "RatingAverage", "ReviewsCount", "SeoTitle", "ShortDescription", "Sku", "SpecialPrice", "SpecialPriceEnd", "SpecialPriceStart", "Specification", "StockQuantity", "ThumbnailImageId", "UpdatedById", "UpdatedOn") VALUES (8, 1, NULL, '2017-02-07 00:00:00', '<p>Movie night in the Venu Great Room theater. We&#39;ll be screening Silver Linings Playbook, with Jennifer Lawrence and Bradley Cooper. 7:30 PM.<br></p>', 0, false, true, false, false, true, true, true, NULL, NULL, NULL, 'Movie Night', NULL, 0, 0, NULL, 2, 0, 'movie-night', '<p>movie night<br></p>', NULL, NULL, NULL, NULL, NULL, NULL, 8, NULL, '2017-01-19 19:00:00');
INSERT INTO "Catalog_Product" ("Id", "BrandId", "CreatedById", "CreatedOn", "Description", "DisplayOrder", "HasOptions", "IsAllowToOrder", "IsCallForPricing", "IsDeleted", "IsFeatured", "IsPublished", "IsVisibleIndividually", "MetaDescription", "MetaKeywords", "MetaTitle", "Name", "NormalizedName", "OldPrice", "Price", "PublishedOn", "RatingAverage", "ReviewsCount", "SeoTitle", "ShortDescription", "Sku", "SpecialPrice", "SpecialPriceEnd", "SpecialPriceStart", "Specification", "StockQuantity", "ThumbnailImageId", "UpdatedById", "UpdatedOn") VALUES (9, 1, NULL, '2017-02-07 00:00:00', '<p>The Venu&#39;s rear pool is closed temporarily. It&#39;s being drained in response to a sighting (unconfirmed) of the Loch Ness monster. But have no fear, we&#39;ll update this as soon as this rumor is disproved and the pool reopened. Unless, of course....<br></p>', 0, false, true, false, false, true, true, true, NULL, NULL, NULL, 'Back Pool Closed', NULL, 0, 0, NULL, 2, 0, 'venu-back-pool-closure', '<p>breaking news<br></p>', NULL, NULL, NULL, NULL, NULL, NULL, 9, NULL, '2017-01-19 00:00:00');
INSERT INTO "Catalog_Product" ("Id", "BrandId", "CreatedById", "CreatedOn", "Description", "DisplayOrder", "HasOptions", "IsAllowToOrder", "IsCallForPricing", "IsDeleted", "IsFeatured", "IsPublished", "IsVisibleIndividually", "MetaDescription", "MetaKeywords", "MetaTitle", "Name", "NormalizedName", "OldPrice", "Price", "PublishedOn", "RatingAverage", "ReviewsCount", "SeoTitle", "ShortDescription", "Sku", "SpecialPrice", "SpecialPriceEnd", "SpecialPriceStart", "Specification", "StockQuantity", "ThumbnailImageId", "UpdatedById", "UpdatedOn") VALUES (10, 1, NULL, '2017-02-07 00:00:00', '<p>Join your neighbors for an exercise hike on Saturday mornings, meeting at 9:00 AM in the Venu Great Room. We&#39;ll walk on various nearby routes for a round trip of an hour or so.<br></p>', 0, false, true, false, false, true, true, true, NULL, NULL, NULL, 'Weekly Exercise Hike', NULL, 0, 0, NULL, 2, 0, 'weekly-exercise-hike', '<p>did you know<br></p>', NULL, NULL, NULL, NULL, NULL, NULL, 10, NULL, '2017-01-19 00:00:00');
INSERT INTO "Catalog_Product" ("Id", "BrandId", "CreatedById", "CreatedOn", "Description", "DisplayOrder", "HasOptions", "IsAllowToOrder", "IsCallForPricing", "IsDeleted", "IsFeatured", "IsPublished", "IsVisibleIndividually", "MetaDescription", "MetaKeywords", "MetaTitle", "Name", "NormalizedName", "OldPrice", "Price", "PublishedOn", "RatingAverage", "ReviewsCount", "SeoTitle", "ShortDescription", "Sku", "SpecialPrice", "SpecialPriceEnd", "SpecialPriceStart", "Specification", "StockQuantity", "ThumbnailImageId", "UpdatedById", "UpdatedOn") VALUES (11, 1, NULL, '2017-02-07 00:00:00', '<p>Cafe Francaise, chicken and broccoli filled crepes, topped with hollandaise sauce served with a house salad and creme brulee.<br></p>', 0, false, true, false, false, true, true, true, NULL, NULL, NULL, 'Cafe Francaise', NULL, 14, 14, NULL, 2, 0, 'cafe-francaise', '<p>Chicken and broccoli filled crepes<br></p>', NULL, NULL, NULL, NULL, NULL, NULL, 11, NULL, '2017-02-01 18:30:00');
INSERT INTO "Catalog_Product" ("Id", "BrandId", "CreatedById", "CreatedOn", "Description", "DisplayOrder", "HasOptions", "IsAllowToOrder", "IsCallForPricing", "IsDeleted", "IsFeatured", "IsPublished", "IsVisibleIndividually", "MetaDescription", "MetaKeywords", "MetaTitle", "Name", "NormalizedName", "OldPrice", "Price", "PublishedOn", "RatingAverage", "ReviewsCount", "SeoTitle", "ShortDescription", "Sku", "SpecialPrice", "SpecialPriceEnd", "SpecialPriceStart", "Specification", "StockQuantity", "ThumbnailImageId", "UpdatedById", "UpdatedOn") VALUES (12, 2, NULL, '2017-02-07 00:00:00', '<p>The soup bar, even here in AZ it can get a little chilly. Come down to the great room and warm up with a selection of soups, breads and salad.<br></p>', 0, false, true, false, false, true, true, true, NULL, NULL, NULL, 'Soup Bar', NULL, 10, 10, NULL, 2, 0, 'soup-bar', '<p>Soups and salad<br></p>', NULL, NULL, NULL, NULL, NULL, NULL, 12, NULL, '2017-02-02 18:30:00');
